import React from 'react';

function SearchPanel({ allGroups, onGroupSelect, selectedGroup, isCollapsed, toggleCollapse }) {
  return (
    <div className={`search-panel ${isCollapsed ? 'collapsed' : ''}`}>
      <button onClick={toggleCollapse} className="collapse-button">
        {isCollapsed ? '>' : '<'}
      </button>
      {!isCollapsed && (
        <div className="group-list">
          {allGroups.map((group) => (
            <div
              key={group.id}
              className={`group-item ${selectedGroup === group.id ? 'selected' : ''}`}
              onClick={() => onGroupSelect(group.id)}
            >
              {group.name}
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default SearchPanel;
